import React from 'react';
import './Select.css';

export const Select = ({ options, onChange }) => (
  <select className="select" onChange={onChange}>
    {options.map((option, index) => (
      <option key={index} value={option.value}>
        {option.label}
      </option>
    ))}
  </select>
);
